import React from "react";
import logo from "../../assets/images/logo.png"
const Navbar = () => {
  return (
    <div>
      {/* upper Navbar */}
      <div>
        <div>
          <div>
            <a href="#">
              <img class="w-16 md:w-32 lg:w-48" src={logo} alt="logo"/>
            </a>
          </div>
        </div>
      </div>

      {/* low er Navbar */}

      <div></div>
    </div>
  );
};

export default Navbar;
